sourcesContent:
const inputData = [
  {
    question: "When do you plan on purchasing a new TV?",
    answers: [
      "Within the month",
      "Within the next six months",
      "Within the year",
      "No current plans",
    ],
  },
  {
    question: "Are you a vegetarian?",
    answers: ["Yes", "No"],
  },
  {
    question: "How satisfied are you with your current internet provider?",
    answers: [
      "Extremely satisfied",
      "Satisfied",
      "Unsatisfied",
      "Extremely Unsatisfied",
      "I do not have an internet provider",
    ],
  },
];

export default inputData;
